const Form = () => {
    return (
    <div className="interested">
        <p>Are you interested with me, and want to collaborate on a project ?</p>
        <form action="">
            <p>CONTACT US</p>
                <input type="text" placeholder="Fullname"/>
                <input type="text" placeholder="Your Email"/>
                <textarea name="" id="" placeholder="Your Message">

                </textarea>
            <button>SEND EMAIL</button>
        </form>
        <style jsx>{`
            .interested {
                margin-top: 2rem;
                text-align: center;
            }
            .interested > p {
                font-size: 1.5rem;
                font-family: 'Alice',serif;
                margin: 0 0 2rem 0;
            }
            form {
                display: flex;
                flex-flow: column;
                width: 23rem;
                margin: 0 auto;
                border: 1px solid #A9A7A7;
                padding: 2rem 3rem 2rem 3rem;
                border-radius: 20px;
            }
            form > p{
                font-family: 'Alice',serif;
                font-size: 1.3rem;
                margin: 0;
                text-align: left;
            }
            input{
                height: 2.5rem;
            }
            textarea {
                min-height: 12rem;
            }
            input , textarea{
                border-radius: 20px;
                border: 1px solid #A9A7A7;
                padding: 0 1rem;
                outline: none;
            }
            textarea {
                padding-top: 1rem;
                resize: vertical;
            }
            form p , input , textarea , button {
                margin-bottom: 1rem;
            }
            button {
                width: 7rem;
                border-radius: 10px;
                border: 1px solid #e34646;
                background-color: #e34646;
                color: #fff;
            }
        `}</style>
    </div>
)}
export default Form;
